import React,{Component } from "react";

class StateClassCom extends Component{
    state={
        color:"Yellow"
    }
    render(){
        return(
            <div>
                <h1>The color selected is {this.state.color}</h1>
            </div>
        )
    }
}
export default StateClassCom;
